import ConceptsItem from "./ConceptsItem";

function Concepts(props) {
  return (
    <ul id="concepts">
      <ConceptsItem
        src={props.concepts[0].image}
        title={props.concepts[0].title}
        desc={props.concepts[0].description}
      ></ConceptsItem>
    </ul>
  );
}

export default Concepts;
